      "full_text" : "身長2m超。\n磨上前の本体であればこうした姿を取るであろう豪壮な体躯で、長義は長い髪を鬱陶しげにかき上げた。\n「あなたを抱えて庭を歩き回りたいと思ったのが運の尽きか」\n審神者は既に膝の上だ。\n膝の上というより長義の中と言った方が適切なくらい、すっぽりと収まっていた。",
