      "favorited" : false,
      "full_text" : "「ここまでが私の考えで、ここからがこれに基づいた予測なんだけど。審神者と刀剣男士に於いては、これの逆が有り得るんじゃないかと思うの」\nそれまで審神者の話を黙って聞いていた山姥切長義は目を瞑って天を仰いだ。\n解ったからだ。\nもう判った。原因は己であると。",
