      "favorited" : false,
      "full_text" : "刀剣女子、山姥切国広は渾身の力を込めて拳を振り下ろした。\n極レベル99の打撃力は即座に本科山姥切長義を地に伏ししめた。\nその、拳に、昨日のネイルが残っている事を思い出し、桜貝の色をしたそれを本科に見せた。\n「そら。これも可愛いだろう」\n長義は息も絶え絶え首を振った。\n「かわ、いくない」",
